import './App.css';
import NavBar from './components/NavBar/NavBar'
import WebFont from 'webfontloader';

useEffect(() => {
  WebFont.load({
    google: {
      families: ['Source Sans Pro']
    }
  });
 }, []);

function App() {
  return (
    <div>
      <NavBar />
    </div>
  );
}

export default App;
